reviews.text:
По опыту существования в Санкт-Петербурге ждал открытия этого магазина.
Поэтому знал, чего жду.
Впечатления не обманули здесь всегда есть:
-кондитерские изделия из Санкт-Петербурга (ф-ка им. Крупской и "Невский кондитер");
-обожаемые мной мини-сушки (хоть и не питерский "Каравай" но съедобные)
-глазированные шоколадом орехи;
-консервы (тушенка из Новгорода великолепна, едим с котом наперегонки!);
-хороший выбор сливочного масла ("Люрпак" (Дания), "Фин" Финляндия, вологодские сорта и пр.)
-белорусские молочные продукты очень недурные на вкус;
-хороший выбор инструментов и электроламп.
Совершенно не понимаю сограждан расстроенных ценами на кушвинский йогурт (говорят. что дорого)  - вам что его больше купить негде?
